import React from "react";
import classes from "./Navbar.module.css";
import Navbar from "react-bootstrap/Navbar";

const navbar = props => (
  <Navbar className={classes.NavBar}>
    <Navbar.Brand href="#home">Home</Navbar.Brand>

    <div>nav bar</div>
  </Navbar>
);

export default navbar;
